INSERT INTO `v1_4df1f74cef64d18adfbd60e196adcd245819f97cbaab53a0453bc1a7a15a35a4` VALUES (1, 0, 1, 1, 0, 1.4, "お！\nあそこに困ってそうな人発見！", 0, "ヒヨリでっす♪\n元気いっぱいがんばるよ♪", 0, 0, 2, "春咲 ひより", "ねぇねぇ、騎士クン\n手伝ってあげようよ～", 1001);
INSERT INTO `v1_4df1f74cef64d18adfbd60e196adcd245819f97cbaab53a0453bc1a7a15a35a4` VALUES (1, 0, 1, 1, 0, 1.4, "大切な人を\n守れるようになりたい…って", 0, "みんなみたいに\nわたしも強くならなきゃ", 0, 0, 2, "草野 優衣", "わ、わたし、\nなに言ってるんだろ\nあはは…", 1002);
INSERT INTO `v1_4df1f74cef64d18adfbd60e196adcd245819f97cbaab53a0453bc1a7a15a35a4` VALUES (1, 0, 1, 1, 0, 1.4, "キミに必要な集中力と感性が", 0, "フェンシングを始めてみては？", 0, 0, 2, "士条 怜", "少しは磨かれると思いますよ。", 1003);
INSERT INTO `v1_4df1f74cef64d18adfbd60e196adcd245819f97cbaab53a0453bc1a7a15a35a4` VALUES (1, 0, 1, 1, 0, 1.5, "今日はなにして遊ぶ？", 0, "ねぇ、にいちゃん！", 0, 0, 2, "穂高 みそぎ", "みそぎはねぇ、\nかくれんぼやりたい！", 1004);
INSERT INTO `v1_4df1f74cef64d18adfbd60e196adcd245819f97cbaab53a0453bc1a7a15a35a4` VALUES (1, 0, 1, 1, 0, 1.4, "ねぇ…", 0, "風宮あかりです", 0, 0, 2, "風宮 あかり", "私といっしょに…\nいかない？", 1006);
INSERT INTO `v1_4df1f74cef64d18adfbd60e196adcd245819f97cbaab53a0453bc1a7a15a35a4` VALUES (1, 0, 1, 1, 0, 1.5, "プリンたべたいのー", 0, "出雲宮子なのー", 0, 0, 2, "出雲 宮子", "食べ物の恨みは怖いのー", 1007);
INSERT INTO `v1_4df1f74cef64d18adfbd60e196adcd245819f97cbaab53a0453bc1a7a15a35a4` VALUES (1, 0, 1, 1, 0, 1.4, "キミもボクの美貌に\n吸い寄せられたんだね。", 0, "ボクは虹村雪。", 0, 0, 2, "虹村 雪", "いいよ。\n見られることは運命さ…", 1008);
INSERT INTO `v1_4df1f74cef64d18adfbd60e196adcd245819f97cbaab53a0453bc1a7a15a35a4` VALUES (1, 0, 1, 1, 0, 1.4, "我が真名は\nアンネローゼ・フォン・シュテッヒパルム！", 0, "フッ…聞いて後悔するがいい！", 0, 0, 2, "柊杏奈", "人呼んで「疾風の冥姫」!!", 1009);
INSERT INTO `v1_4df1f74cef64d18adfbd60e196adcd245819f97cbaab53a0453bc1a7a15a35a4` VALUES (1, 0, 1, 1, 0, 1.5, "うさぎさん、\n運命の王子はんに巡りあわせてくれて", 0, "マホマホ王国のプリンセス、\nまほ姫どす", 0, 0, 2, "姫宮 真歩", "ほんまおおきにやわ～♪", 1010);
INSERT INTO `v1_4df1f74cef64d18adfbd60e196adcd245819f97cbaab53a0453bc1a7a15a35a4` VALUES (1, 0, 1, 1, 0, 1.4, "生き別れたお兄ちゃんを探して\n三千世界！", 0, "衣之咲璃乃です！", 0, 0, 2, "衣之咲 璃乃", "ここで会ったが\n100年目～！", 1011);
INSERT INTO `v1_4df1f74cef64d18adfbd60e196adcd245819f97cbaab53a0453bc1a7a15a35a4` VALUES (1, 0, 1, 1, 0, 1.4, "ち、超能力って…\n何のことかな～？", 0, "私はハツネ、\n結構強いんだよ。\nきらーん☆", 0, 0, 2, "柏崎 初音", "…って、お願い！\n誰にも言わないでおいて～！", 1012);
INSERT INTO `v1_4df1f74cef64d18adfbd60e196adcd245819f97cbaab53a0453bc1a7a15a35a4` VALUES (1, 0, 1, 1, 0, 1.4, "一応カリスマ読モJKやってまっす！", 0, "ちょす！\n美波鈴奈だよ～♪", 0, 0, 2, "美波 鈴奈", "ヒデサイまぢ\nGF（グッドフィーリング）～♪", 1016);
INSERT INTO `v1_4df1f74cef64d18adfbd60e196adcd245819f97cbaab53a0453bc1a7a15a35a4` VALUES (1, 0, 1, 1, 0, 1.4, "東京は遊園地みたいなところさー", 0, "はいたーい。\n喜屋武香織さー。", 0, 0, 2, "喜屋武 香織", "でも、沖縄もとってもいいとこさー", 1017);
INSERT INTO `v1_4df1f74cef64d18adfbd60e196adcd245819f97cbaab53a0453bc1a7a15a35a4` VALUES (1, 0, 1, 1, 0, 1.4, "先生って呼ばれるのは\nくすぐったいから", 0, "支倉伊緒です。", 0, 0, 2, "支倉 伊緒", "イオちゃんって呼んでね。", 1018);
INSERT INTO `v1_4df1f74cef64d18adfbd60e196adcd245819f97cbaab53a0453bc1a7a15a35a4` VALUES (1, 0, 1, 1, 0, 1.5, "あ！/\お兄ちゃ～ん\nまってよ～", 0, "ふえ…？\nミミ、むずかしいこと\nよくわかんない…", 0, 0, 2, "茜 ミミ", "ミミをおいてかないでぇ～", 1020);
INSERT INTO `v1_4df1f74cef64d18adfbd60e196adcd245819f97cbaab53a0453bc1a7a15a35a4` VALUES (1, 0, 1, 1, 0, 1.5, "あの……\nふぇ……", 0, "あ…あの…えっと…\n栗…林…くるみ…です……", 0, 0, 2, "栗林 くるみ", "ふぇぇぇぇぇん……", 1021);
INSERT INTO `v1_4df1f74cef64d18adfbd60e196adcd245819f97cbaab53a0453bc1a7a15a35a4` VALUES (1, 0, 1, 1, 0, 1.4, "こんな私に貴重な時間を\n割いていただき、", 0, "風宮よりです。\nあああああ！", 0, 0, 2, "風宮 より", "なんてありがとうございます！", 1022);
INSERT INTO `v1_4df1f74cef64d18adfbd60e196adcd245819f97cbaab53a0453bc1a7a15a35a4` VALUES (1, 0, 1, 1, 0, 1.5, "おにいちゃんどこいくの？\nえ？", 0, "私、アヤネ！\nぷうきちと一緒についてってあげるね！", 0, 0, 2, "北条 綾音", "私こっち行きたいー\nね、早く早くー", 1023);
INSERT INTO `v1_4df1f74cef64d18adfbd60e196adcd245819f97cbaab53a0453bc1a7a15a35a4` VALUES (1, 0, 1, 1, 0, 1.4, "ふ、不束者ですが\nどうぞ末永く…って、", 0, "わっ…わっ…私、\n天野すずめといいます！", 0, 0, 2, "天野 すずめ", "これて何か違う…\nあああすみません！", 1025);
INSERT INTO `v1_4df1f74cef64d18adfbd60e196adcd245819f97cbaab53a0453bc1a7a15a35a4` VALUES (1, 0, 1, 1, 0, 1.4, "あなたは…運命の……\n伴侶……", 0, "……クスクス…私は\n…倉石恵理子……", 0, 0, 2, "倉石 恵理子", "離しませんわ………\n絶対に…!!", 1027);
INSERT INTO `v1_4df1f74cef64d18adfbd60e196adcd245819f97cbaab53a0453bc1a7a15a35a4` VALUES (1, 0, 1, 1, 0, 1.4, "その無駄を省くことができれば、\nもっと余裕のある暮らしができるっ！", 0, "佐々木咲恋よ。\nねえ、世の中に無駄なことが\n多すぎると思わない？", 0, 0, 2, "佐々木 咲恋", "…そうでしょ？？", 1028);
INSERT INTO `v1_4df1f74cef64d18adfbd60e196adcd245819f97cbaab53a0453bc1a7a15a35a4` VALUES (1, 0, 1, 1, 0, 1.4, "ぇっと…\nキミ、私のこと知らないの?!", 0, "桜井望だよ！\nよろしくねっ", 0, 0, 2, "桜井 望", "あはは、\n私もまだまだだなぁ～", 1029);
INSERT INTO `v1_4df1f74cef64d18adfbd60e196adcd245819f97cbaab53a0453bc1a7a15a35a4` VALUES (1, 0, 1, 1, 0, 1.4, "初めまして、\n私はニノン・ジュベール申すデス！", 0, "デケデケデンっ！", 0, 0, 2, "ニノン・ジュベール", "ショーグン、\nワタシと一緒に天下統一デース！", 1030);
INSERT INTO `v1_4df1f74cef64d18adfbd60e196adcd245819f97cbaab53a0453bc1a7a15a35a4` VALUES (1, 0, 1, 1, 0, 1.4, "でもって私の隣にいるのが……\nえ、見えない？", 0, "上喜しのぶです。\n手元のドクロが父です。", 0, 0, 2, "上喜 しのぶ", "おかしいですね……", 1031);
INSERT INTO `v1_4df1f74cef64d18adfbd60e196adcd245819f97cbaab53a0453bc1a7a15a35a4` VALUES (1, 0, 1, 1, 0, 1.5, "けんども\nそれには足りないモンが…", 0, "目指すはビッグな\nお笑い芸人だっぺ！", 0, 0, 2, "野戸まひる", "そう、\nオラのボケに突っ込める相方が…！", 1033);
INSERT INTO `v1_4df1f74cef64d18adfbd60e196adcd245819f97cbaab53a0453bc1a7a15a35a4` VALUES (1, 0, 1, 1, 0, 1.4, "ちょっと緊張しちゃって…", 0, "あの…私…綾瀬ゆかりです…\nあの…ごめんなさい！", 0, 0, 2, "綾瀬 ゆかり", "ちょ\nちょっと一杯飲んできます…！", 1034);
INSERT INTO `v1_4df1f74cef64d18adfbd60e196adcd245819f97cbaab53a0453bc1a7a15a35a4` VALUES (1, 0, 1, 1, 0, 1.5, "知らない人とは話しちゃいけないので", 0, "氷川鏡華…です", 0, 0, 2, "氷川 鏡華", "これ以上お話しすることは…\nないです！", 1036);
INSERT INTO `v1_4df1f74cef64d18adfbd60e196adcd245819f97cbaab53a0453bc1a7a15a35a4` VALUES (1, 0, 1, 1, 0, 1.4, "……あ、アラーム。", 0, "柏崎…栞です。", 0, 0, 2, "柏崎 栞", "私体が弱いから、\n30分に一度休憩しないと\nいけないんです。", 1038);
INSERT INTO `v1_4df1f74cef64d18adfbd60e196adcd245819f97cbaab53a0453bc1a7a15a35a4` VALUES (1, 0, 1, 1, 0, 1.4, "私、一人も友達がいなくて……", 0, "ふ、双葉碧です。", 0, 0, 2, "双葉 碧", "野に咲く花が、\n唯一の話相手です。", 1040);
INSERT INTO `v1_4df1f74cef64d18adfbd60e196adcd245819f97cbaab53a0453bc1a7a15a35a4` VALUES (1, 0, 1, 1, 0, 1.4, "私の歌声で、\n皆さんが幸せになってくれたらいいなって…", 0, "三角千歌です。", 0, 0, 2, "三角 千歌", "そう思っています。", 1042);
INSERT INTO `v1_4df1f74cef64d18adfbd60e196adcd245819f97cbaab53a0453bc1a7a15a35a4` VALUES (1, 0, 1, 1, 0, 1.4, "あぁ？\nお前のそいつの仲間か？", 0, "安芸真琴だ。", 0, 0, 2, "安芸 真琴", "う、疑ってすまなかったな…", 1043);
INSERT INTO `v1_4df1f74cef64d18adfbd60e196adcd245819f97cbaab53a0453bc1a7a15a35a4` VALUES (1, 0, 1, 1, 0, 1.4, "生けとし生ける全ての者よ！", 0, "わらわこそは夜を総べる者！", 0, 0, 2, "イリヤ・オーンスタイン", "わらわの偉大な力に\nひれ伏すがいい！\nはっはっは！", 1044);
INSERT INTO `v1_4df1f74cef64d18adfbd60e196adcd245819f97cbaab53a0453bc1a7a15a35a4` VALUES (1, 0, 1, 1, 0, 1.4, "ぐふふふふ……はっ！", 0, "そこで騎士は妖精を乱暴に……", 0, 0, 2, "遠見 空花", "ｌク、クウカに何かご用ですか!?", 1045);
INSERT INTO `v1_4df1f74cef64d18adfbd60e196adcd245819f97cbaab53a0453bc1a7a15a35a4` VALUES (1, 0, 1, 1, 0, 1.4, "自由気ままで♪\n寝て遊んで、食べてケンカして…", 0, "宮坂たまきにゃ♪\n猫はいいにゃよ？", 0, 0, 2, "宮坂たまき", "う～ん…\n猫ってホントに最高にゃ～♪", 1046);
INSERT INTO `v1_4df1f74cef64d18adfbd60e196adcd245819f97cbaab53a0453bc1a7a15a35a4` VALUES (1, 0, 1, 1, 0, 1.4, "それでは早速クエストに…", 0, "大神美冬よ！", 0, 0, 2, "大神 美冬", "…と思ったら\nバイトの時間だ！\nまたあとでね！", 1048);
INSERT INTO `v1_4df1f74cef64d18adfbd60e196adcd245819f97cbaab53a0453bc1a7a15a35a4` VALUES (1, 0, 1, 1, 0, 1.4, "クエストもバトルも\n掃除も洗濯も", 0, "星野静流だよ！", 0, 0, 2, "星野静流", "お姉ちゃんがぜ～んぶ\nやってあげるからね！", 1049);
INSERT INTO `v1_4df1f74cef64d18adfbd60e196adcd245819f97cbaab53a0453bc1a7a15a35a4` VALUES (1, 0, 1, 1, 0, 1.5, "見ての通りの\nセクシー美少女で", 0, "アタシは玉泉美咲。", 0, 0, 2, "玉泉美咲", "学校では誰もが憧れる\nアイドル的な存在ってやつよ♪", 1050);
INSERT INTO `v1_4df1f74cef64d18adfbd60e196adcd245819f97cbaab53a0453bc1a7a15a35a4` VALUES (1, 0, 1, 1, 0, 1.4, "？？？？", 0, "？？？", 0, 0, 2, "リマ", "？？？？", 1052);
INSERT INTO `v1_4df1f74cef64d18adfbd60e196adcd245819f97cbaab53a0453bc1a7a15a35a4` VALUES (1, 0, 1, 1, 0, 1.5, "菓子でつろうなどと\n稚拙な策を……", 0, "モニカ・ヴァイスヴィントだ。", 0, 0, 2, "モニカ・ヴァイスヴィント", "そ、そこまでいうなら\nもらってやる", 1053);
INSERT INTO `v1_4df1f74cef64d18adfbd60e196adcd245819f97cbaab53a0453bc1a7a15a35a4` VALUES (1, 0, 1, 1, 0, 1.5, "菓子でつろうなどと\n稚拙な策を……", 0, "モニカ・ヴァイスヴィントだ。", 0, 0, 2, "ペコリーヌ", "そ、そこまでいうなら\nもらってやる", 1058);
INSERT INTO `v1_4df1f74cef64d18adfbd60e196adcd245819f97cbaab53a0453bc1a7a15a35a4` VALUES (1, 0, 1, 1, 0, 1.5, "菓子でつろうなどと\n稚拙な策を……", 0, "モニカ・ヴァイスヴィントだ。", 0, 0, 2, "コッコロ", "そ、そこまでいうなら\nもらってやる", 1059);
INSERT INTO `v1_4df1f74cef64d18adfbd60e196adcd245819f97cbaab53a0453bc1a7a15a35a4` VALUES (1, 0, 1, 1, 0, 1.5, "菓子でつろうなどと\n稚拙な策を……", 0, "モニカ・ヴァイスヴィントだ。", 0, 0, 2, "キャル", "そ、そこまでいうなら\nもらってやる", 1060);
